<template>
  <div>
    <div ref="bubbleBox" class="bubble">
      <span ref="text" class="text"></span>
    </div>
    <div ref="bubbleBox2" class="bubble">
      <span ref="text2" class="text"></span>
    </div>
    <div class="bot"></div>
  </div>
</template>
<script setup>
import { onMounted, ref } from 'vue';
import { gsap } from 'gsap';
import { TextPlugin } from 'gsap/TextPlugin';

gsap.registerPlugin(TextPlugin);

const text = ref(null);
const bubbleBox = ref(null);
const text2 = ref(null);
const bubbleBox2 = ref(null);

onMounted(() => {
  var tl = gsap.timeline({ repeat: -1, repeatDelay: 10 });

  tl.fromTo(
    bubbleBox.value,
    {
      scale: 0,
      autoAlpha: 0,
    },
    {
      scale: 1,
      autoAlpha: 1,
      transformOrigin: "right bottom",
      duration: 0.75,
      ease: 'power2.out',
    },
    0
  );
  // 打字机效果
  tl.to(
    text.value,
    {
      duration: 1,
      text: '欢迎来到 K-RPA Studio!'
    },
    0.25
  );
  tl.to(
    bubbleBox.value,
    {
      y: -50,
      className:"bubble not",
      duration: 0.75,
      ease: 'power2.out',
    },
    2
  );

  // 对话框 2
  tl.fromTo(
    bubbleBox2.value,
    {
      scale: 0,
      autoAlpha: 0,
    },
    {
      scale: 1,
      autoAlpha: 1,
      transformOrigin: "right bottom",
      duration: 0.75,
      ease: 'power2.out',
    },
    2
  );
  tl.to(
    text2.value,
    {
      duration: 1,
      text: '点击这里查看我们的示例, 快来试试吧!'
    },
    2.25
  );
  tl.to(
    [bubbleBox.value, bubbleBox2.value],
    {
      autoAlpha: 0,
      duration: 1,
      ease: 'power2.out',
    },
    10
  );
  // tl.timeScale(0.25)
  // tl.pause()
  // tl.seek(4);
});
</script>

<style scoped>
.text {
  @apply text-base font-semibold;
  background: linear-gradient(90deg, #4752e6 0, #cf5ecf 100%);
  background-clip: text;
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
}
.bubble {
  @apply fixed pt-2 pb-3 px-3 right-28 bottom-36 select-none invisible;
  height: 44px;
  border-image-slice: 6 22 12 6 fill;
  /* border-image-width: 12px 44px 24px 12px; */
  border-image-width: auto;
  border-image-outset: 0px 0px 0px 0px;
  border-image-repeat: stretch stretch;
  border-image-source: url("./bubble-box.svg");
  border-style: solid;
}
.bubble.not {
  @apply py-2 px-3;
  height: auto;
  border-image-slice: 6 6 6 6 fill;
  border-image-source: url("./bubble-box2.svg");
}
.bot {
  @apply size-28 bg-center bg-[auto_16rem];
  background-image: url(data:image/png;base64,);
}
</style>
